    [],nt"num_tags": 4,nt"name": "chronic-wasting-disease-contingency-plan-for-neal-smith-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "Chronic wasting disease (CWD) is a transmissible
    spongiform encephalopathy (TSE) affecting deer and elk (cervids) in North America.
     The goal of this contingency plan is to minimize the negative impact of CWD on
    deer and elk on Service lands at Neal Smith National Wildlife Refuge.  The staff
    of Neal Smith will work closely with the Iowa Department of Natural Resources (IDNR)
    using the IDNR guidelines on surveillance and detection policies already in place
    when making a decision on what action will be taken on the deer and elk herds.  This
    plan summarizes the history and monitoring of CWD in Wisconsin, Illinois, Missouri,
    Nebraska, South Dakota, and Minnesota.  It also discusses surveillance, detection,
    and eradication methods set forth by the IDNR.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
